    ["101207"]={id=101207,chapterId=101,chapterEn="CHAPTER ONE",difficulty=2,levelIndex=7,name="驻队往事",levelType=1,preLevel=101206,unlockDes="",indexDes="H1-7",scenarioId=0,startDialog1=0,startDialog2=0,levelInfo="I.S.1954.2.22     瓦哈纳控制区中央核心",levelDes="法尼娅发现了埃达的秘密与往事，与此同时，更多的异生体侵入了温德兰德市区。埃达被异生体击中，失去战力。瓦哈纳的众人决定在雨中开始与异生体作战......",weather=1,prefabType=6,winCondition="击破高危险目标",winConditionSup="善用不同式杖之间的配合，可提升通过概率",teamType=1001,selectPosX=2370.0,talkGroupID=xlsNilTable,tips="血流的街道上，一片撕裂的“帆”浸在其中，其中是几个惊慌的人影和倒塌的帆的桅杆。"},
    ["101208"]={id=101208,chapterId=101,chapterEn="CHAPTER ONE",difficulty=2,levelIndex=8,name="从未被眷顾吗",levelType=1,preLevel=101207,unlockDes="",indexDes="H1-8",scenarioId=0,startDialog1=0,startDialog2=0,levelInfo="I.S.1954.2.23     瓦哈纳控制区中央核心",levelDes="在尼伯赞歌上，埃达的祈求病有所好转。可众人来不及高兴，入侵温德兰德的异生体发起了更加猛烈的进攻......温德兰德斯露德驻地遭到了毁灭性的打击，夏洛请求众人的支援......",weather=1,prefabType=6,winCondition="击破高危险目标",winConditionSup="善用不同式杖之间的配合，可提升通过概率",teamType=1001,selectPosX=2370.0,talkGroupID=xlsNilTable,tips="不用管我了……请让她们……安全地活下来吧——"},
    ["101209"]={id=101209,chapterId=101,chapterEn="CHAPTER ONE",difficulty=2,levelIndex=9,name="一次呜咽",levelType=1,preLevel=101208,unlockDes="",indexDes="H1-9",scenarioId=0,startDialog1=0,startDialog2=0,levelInfo="I.S.1954.2.24     瓦哈纳控制区中央核心",levelDes="驻地的防守作战失败，可是众人仍然继续在战斗。守护温德兰德水坝与嫁接其上的主巨人，是一切的关键。残酷的战斗，开始了......",weather=1,prefabType=6,winCondition="击破高危险目标",winConditionSup="善用不同式杖之间的配合，可提升通过概率",teamType=1001,selectPosX=2370.0,talkGroupID=xlsNilTable,tips="在倒塌的驻队房屋一侧，电话铃在此时的寂静中响起——"},
    ["101210"]={id=101210,chapterId=101,chapterEn="CHAPTER ONE",difficulty=2,levelIndex=10,name="不能遮蔽的雨衣",levelType=1,preLevel=101209,unlockDes="",indexDes="H1-10",scenarioId=0,startDialog1=0,startDialog2=0,levelInfo="I.S.1954.2.25     瓦哈纳控制区中央核心",levelDes="随着水坝的破坏，众人面临的局面越发不利，为了掩护受到灾难的民众，只能开始一步不能后退的作战......",weather=1,prefabType=6,winCondition="击破高危险目标",winConditionSup="善用不同式杖之间的配合，可提升通过概率",teamType=1001,selectPosX=2370.0,talkGroupID=xlsNilTable,tips="……哪怕让主巨人产生一个裂缝……这片平原就会被鲜血浇灌"},
